package main

import "fmt"

func main() {
	input := input()

	buffer := ""

	for i := range input {
		// fmt.Println("input", i, string(v))

		if i >= 3 {
			buffer = input[i-3 : i+1]
			// fmt.Println(buffer)

			marker := isMarker(buffer)
			if marker {

				fmt.Println("marker found ", buffer, " after ", i+1)
				break
			}
		}
	}

	fmt.Println()

	for i := range input {
		// fmt.Println("input", i, string(v))

		if i >= 14 {
			buffer = input[i-13 : i+1]
			// fmt.Println(buffer)

			marker := isMarker(buffer)
			if marker {
				fmt.Println("message found ", buffer, " after ", i+1)
				break
			}
		}
	}
}

func isMarker(input string) bool {
	marker := true
	for i, in := range input {
		for j, in2 := range input {
			if i != j && in == in2 {
				marker = false
			}
		}
	}
	return marker
}

